for (let i = 0; i < 2; i++) {
  const noiseface = bt.copy(svg);
  bt.scale(noiseface, [0.0475 + (i * 0.0002), 0.0475 + (i * 0.0002)]);
  bt.translate(noiseface, [-2631, -2847])
  bt.iteratePoints(noiseface, (pt, tValue) => {
    const [x, y] = pt
    pt[0] += bt.noise(y * 7.3) * bt.rand() * (i * 3 + 4) + Math.sin(y * 0.42)
    if (bt.rand() < 0.97) return pt
    if (bt.rand() < lerp(0, 1, 0.20 * tValue ** 2)) return 'BREAK'
    if (bt.rand() < 0.44) return 'BREAK'
  })
  bt.join(face, noiseface)
  bt.resample(face, bt.randInRange(1, i * 5))
}

const background = new bt.Turtle();

function isPointInsidePolygon(pt, polygon) {
  const x = pt[0];
  const y = pt[1];
  let inside = false;

  for (let i = 0, j = polygon.length - 1; i < polygon.length; j = i++) {
    const xi = polygon[i][0];
    const yi = polygon[i][1];
    const xj = polygon[j][0];
    const yj = polygon[j][1];

    const intersect =
      yi > y !== yj > y && x < ((xj - xi) * (y - yi)) / (yj - yi) + xi;

    if (intersect) {
      inside = !inside;
    }
  }

  return inside;
}

